import Basket from'../components/Basket'
import ShoppingList from '../components/ShoppingList'

function Home() {
  return (
      <div>
          <Header/>
          <div className="flex justify-between">
              <Basket/>
              <ShoppingList/>
          </div>
</div>
)
    ;
}

export default Home;
